import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { BrowserRouter as Router, } from 'react-router-dom';
import Routes from './Signup/Routes';

ReactDOM.render(
  <Router>
    <div className="App">
      <Routes />
    </div>
  </Router>,
  document.getElementById('root')
);
